import axios from "axios";
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { removeUserSession } from "./Utils/Common";
import { TimeoutLogic } from "./Utils/TimeoutLogic";

function Dashboard() {
  const [data, setData] = useState("");
  const navigate = useNavigate();

  const userdata = {
    "student_admissions_id": 1013
  }

  const headers = {
    'Content-Type': 'application/json',
    'Authorization': `Bearer ${"eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJyZXN1bHQiOnsiaWQiOjEsIm5hbWUiOiJBZG1pbiIsImVtYWlsIjoiYWRtaW5AZ21haWwuY29tIiwiZW1haWxfdmVyaWZpZWRfYXQiOm51bGwsInJlbWVtYmVyX3Rva2VuIjpudWxsLCJjcmVhdGVkX2F0IjpudWxsLCJ1cGRhdGVkX2F0IjpudWxsLCJyb2xlIjoiYWRtaW4iLCJwYXNzd29yZF9kaWdlc3QiOm51bGx9LCJpYXQiOjE2Njc5OTAzNTgsImV4cCI6MTY2Nzk5NzU1OH0.Yi6IqtALDGyRjWtsnp_OeZJugGFa4FR5VAjc03BLKMU"}`
  }

  useEffect(() => {
    axios
      .post(
        "https://7052-103-141-51-42.in.ngrok.io/api/v1/studentProfile",
        userdata,
        {
          headers: headers,
        }
      )
      .then((res) => {
        setData(res.data.data[0]);
      });
  }, []);

  const handleLogout = () => {
    removeUserSession();
    navigate("/");
  };

  return (
    <div className="container log bg-dark text-white">
     <table className="table text-white">
  <thead>
    <tr>
      <th scope="col">1</th>
      <th scope="col">First</th>
      <th scope="col">Last</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <th scope="row">1</th>
      <td>{data.student_allocation_id}</td>
      <td>{data.from_grade_id}</td>
      <td>{data.created_at}</td>
      <td>{data.updated_at}</td>
      <td>{data.student_admissions_id}</td>
      <td>{data.student_id}</td>
      <td>{data.grade_section_id}</td>
      <td>{data.year_id}</td>
      <td>{data.mode_of_transport}</td>
      <td>{data.mode_of_transport_allocation}</td>
      <td>{data.mode_of_transport_touched}</td>
      <td>{data.grade_master_id}</td>
      <td>{data.grade_master}</td>
      <td>{data.description}</td>
      <td>{data.section}</td>
      <td>{data.academic_year_id}</td>
      <td>{data.student_name}</td>
      <td>{data.DOB}</td>
      <td>{data.gender}</td>

      <td>{data.email}</td>
      <td>{data.admission_date}</td>

      <td>{data.previous_school_info}</td>
      <td>{data.father_name}</td>
      <td>{data.academic_year_id}</td>
      <td>{data.academic_year_id}</td>
      <td>{data.academic_year_id}</td>


      <td>{data.academic_year_id}</td>





    </tr>


  </tbody>
</table>
      Welcome to Dashboard !<br />
      <br />
      <input
        type="button"
        className=" btn btn-primary"
        onClick={handleLogout}
        value="Logout"
      />
      <TimeoutLogic />
    </div>
  );
}

export default Dashboard;
